import "./App.css";
import styled from "styled-components";
import Carousel from 'react-multi-carousel';

function App() {
  return (
    <div className="App">
      <nav>
        <ul>
          <li data-selected>home</li>
          <li>band</li>
          <li>music</li>
          <li>contact</li>
        </ul>
      </nav>
      <Title>
        <div>
          <h1>PANFU</h1>
          <h2>Pick A Name For Us</h2>
        </div>
      </Title>
      <section>
      <Carousel responsive={responsive}>
  <div>Item 1</div>
  <div>Item 2</div>
  <div>Item 3</div>
  <div>Item 4</div>
</Carousel>;
      </section>
    </div>
  );
}

export default App;

const Title = styled.section`
  color: white;
  height: calc(100vh - 132px);
  padding: auto;
  position: relative;
  & > div {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    text-align: center;
    & > h1 {
      font-size: 300px;
      padding: 0;
      margin: 0;
      transform: translateY(30px);
    } 
    & > h2 {
      font-size: 110px;
      padding: 0;
      margin: 0;
      font-weight: normal;
      transform: translateY(-30px);
    }
  }

`;
